import React, { useEffect } from 'react'
import {useDispatch, useSelector} from 'react-redux'
import { Row, Col} from 'react-bootstrap'
import Seller from '../components/Seller'
import Message from '../components/Message'
import Loader from '../components/Loader'
import {listSellers} from '../actions/sellerActions'

const SellersScreens = () => {
    const dispatch= useDispatch()
    const sellerList=useSelector(state=>state.sellerList)
    const {loading,error,sellers}= sellerList

    useEffect(()=>{
        dispatch(listSellers())
    }, [dispatch])
    return (
        <>
            <h1> Our Associated Sellers</h1>
            {loading? (<Loader />): error?(<Message variant='danger'>{error}</Message>):(
                <Row>
                        {sellers.map(seller =>(
                     <Col key={seller._id} sm={12} md={6} lg={4} xl={3}>
                         <Seller seller={seller} />
                      </Col>
                 ))}
            </Row>
            )}
        </>
    )
}

export default SellersScreens
